import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Navbar = () => {
  const [darkMode, setDarkMode] = useState(false);

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
  };

  return (
<nav class="navbar  navbar-expand-lg navbar-dark bg-dark fixed-top p-0.5">
    <div class="container-fluid">
        <a class="navbar-brand">
            <i class="bi bi-ticket" width="50px">Concert Bay</i>
        </a>
        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                <li class="nav-item">
                    <a class="nav-link active" href="{% url 'landing' %}">Conciertos</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" href="/artistas">Artistas</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" href="/patrocinadores">Patrocinadores</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" href="#">Contactanos</a>
                </li>
            </ul>
            <ul class="nav navbar-nav navbar-right">
                <div class="dropdown dropdown-menu-end">
                    
                    <button type="button" class="btn dropdown-toggle" data-bs-toggle="dropdown">
                        <div class="d-flex">
                            Demo
                        </div>
                    </button>
                    <ul class="dropdown-menu">
                        <li><a class="dropdown-item" href="/InfoComprador">Mi Informacion</a></li>
                        <li><a class="dropdown-item" href="/UserUpdate">Modificar Clave</a></li>
                        <li><a class="dropdown-item" href="/get_misreservas">Mis Reservas</a></li>
                        <li><a class="dropdown-item" href="/privacidad">Declaracion de Privacidad</a></li>
                        <li><a class="dropdown-item" href="/politica">Politicas del Sitio</a></li>
                        <li><a class="dropdown-item" href="/logout">Cerrar Sesion</a></li>
                    </ul>
                </div>              
            </ul>
        </div>
    </div>
</nav>

    // <nav className={`navbar navbar-expand-lg ${darkMode ? 'navbar-dark bg-dark' : 'navbar-light bg-light'}`}>
    //   <a className="navbar-brand" href="#">Navbar</a>
